INSERT INTO @IepDisability VALUES ('52431290-0b16-4732-840b-10986a1fbe1e', 'Deafness', '<div>Deafness means a hearing impairment that is so severe that the child is impaired in processing linguistic information through hearing, with or without amplification that adversely affects a child''s educational performance.</div>', NULL)
INSERT INTO @IepDisability VALUES ('a1504419-19f6-434b-b4a3-1e5a69e99a9b', 'Emotional Disturbance', '<div>(i) Emotional disturbance means a condition exhibiting one or more of the following characteristics over a long period of time and to a marked degree that adversely affects a child''s educational performance:</div>	<div class="indent1">	<div>(A) An inability to learn that cannot be explained by intellectual, sensory, or health factors.</div>	<div>(B) An inability to build or maintain satisfactory interpersonal relationships with peers and teachers.</div>	<div>(C) Inappropriate types of behavior or feelings under normal circumstances.</div>	<div>(D) A general pervasive mood of unhappiness or depression.</div>	<div>(E) A tendency to develop physical symptoms or fears associated with personal or school problems.</div>	</div><div>(ii) Emotional disturbance includes schizophrenia. The term does not apply to children who are socially maladjusted, unless it is determined that they have an emotional disturbance under paragraph (c)(4)(i) of this section.</div>', NULL)
INSERT INTO @IepDisability VALUES ('3567f202-646f-4a7e-860a-2100242c7182', 'Other Health Impairment', '<div>Other health impairment means having limited strength, vitality, or alertness, including a heightened alertness to environmental stimuli, that results in limited alertness with respect to the educational environment, that--</div><div class="indent1"><div>(i) Is due to chronic or acute health problems such as asthma, attention deficit disorder or attention deficit hyperactivity disorder, diabetes, epilepsy, a heart condition, hemophilia, lead poisoning, leukemia, nephritis, rheumatic fever, sickle cell anemia, and Tourette syndrome; and</div><div>(ii) Adversely affects a child''s educational performance.</div></div>', NULL)
INSERT INTO @IepDisability VALUES ('79450790-72a4-4f16-8840-6193db199a1e', 'Hearing Impairment', '<div>Hearing impairment means an impairment in hearing, whether permanent or fluctuating, that adversely affects a child''s educational performance but that is not included under the definition of deafness in this section.</div>', NULL)
INSERT INTO @IepDisability VALUES ('607943a6-7cfa-4bd1-9044-6a3634ab1ed5', 'Orthopedic Impairment', '<div>Orthopedic impairment means a severe orthopedic impairment that adversely affects a child''s educational performance. The term includes impairments caused by a congenital anomaly, impairments caused by disease (e.g., poliomyelitis, bone tuberculosis), and impairments from other causes (e.g., cerebral palsy, amputations, and fractures or burns that cause contractures).</div>', NULL)
INSERT INTO @IepDisability VALUES ('96a66c19-7aab-4ee6-aa81-7cd8cd4feb09', 'Speech or Language Impairment', '<div>Speech or language impairment means a communication disorder, such as stuttering, impaired articulation, a language impairment, or a voice impairment, that adversely affects a child''s educational performance.</div>', NULL)
INSERT INTO @IepDisability VALUES ('6acbabea-f128-4d52-a7c4-9478a9b9facb', 'Mental Retardation', '<div>Mental retardation means significantly subaverage general intellectual functioning, existing concurrently with deficits in adaptive behavior and manifested during the developmental period, that adversely affects a child''s educational performance.</div>', NULL)
INSERT INTO @IepDisability VALUES ('8d9b3b54-4080-4d5e-a196-956d5223e479', 'Autism', '<div>(i) Autism means a developmental disability significantly affecting verbal and nonverbal communication and social interaction, generally evident before age three, that adversely affects a child''s educational performance. Other characteristics often associated with autism are engagement in repetitive activities and stereotyped movements, resistance to environmental change or change in daily routines, and unusual responses to sensory experiences.</div><div>(ii) Autism does not apply if a child''s educational performance is adversely affected primarily because the child has an emotional disturbance, as defined in paragraph (c)(4) of this section.</div><div>(iii) A child who manifests the characteristics of autism after age three could be identified as having autism if the criteria in paragraph (c)(1)(i) of this section are satisfied.</div>', NULL)
INSERT INTO @IepDisability VALUES ('e65e6aae-ae9b-4275-b547-9ce1a4b9eef3', 'Traumatic Brain Injury', '<div>Traumatic brain injury means an acquired injury to the brain caused by an external physical force, resulting in total or partial functional disability or psychosocial impairment, or both, that adversely affects a child''s educational performance. Traumatic brain injury applies to open or closed head injuries resulting in impairments in one or more areas, such as cognition; language; memory; attention; reasoning; abstract thinking; judgment; problem-solving; sensory, perceptual, and motor abilities; psychosocial behavior; physical functions; information processing; and speech. Traumatic brain injury does not apply to brain injuries that are congenital or degenerative, or to brain injuries induced by birth trauma.</div>', NULL)
INSERT INTO @IepDisability VALUES ('ac7d83da-b896-4a27-a983-a48243819bc6', 'Deaf-Blindness', '<div>Deaf-blindness means concomitant hearing and visual impairments, the combination of which causes such severe communication and other developmental and educational needs that they cannot be accommodated in special education programs solely for children with deafness or children with blindness.</div>', NULL)
INSERT INTO @IepDisability VALUES ('ca41a561-16be-4e21-be8a-bc59ed86c921', 'Multiple Disabilities', '<div>Multiple disabilities means concomitant impairments (such as mental retardation-blindness or mental retardation-orthopedic impairment), the combination of which causes such severe educational needs that they cannot be accommodated in special education programs solely for one of the impairments. Multiple disabilities does not include deaf-blindness.</div>', NULL)
INSERT INTO @IepDisability VALUES ('0e026822-6b22-43a1-bd6e-c1412e3a6fa3', 'Specific Learning Disability', '<div>Specific learning disability.</div><div class="indent1"><div>(i) General. Specific learning disability means a disorder in one or more of the basic psychological processes involved in understanding or in using language, spoken or written, that may manifest itself in the imperfect ability to listen, think, speak, read, write, spell, or to do mathematical calculations, including conditions such as perceptual disabilities, brain injury, minimal brain dysfunction, dyslexia, and developmental aphasia.</div><div>(ii) Disorders not included. Specific learning disability does not include learning problems that are primarily the result of visual, hearing, or motor disabilities, of mental retardation, of emotional disturbance, or of environmental, cultural, or economic disadvantage.</div></div>', '19b5684f-99cc-4d93-8f25-2b05c4300d0b')
INSERT INTO @IepDisability VALUES ('d31e4ed0-9a37-490f-b49b-ff18133644fe', 'Visual Impairment', '<div>Visual impairment including blindness means an impairment in vision that, even with correction, adversely affects a child''s educational performance. The term includes both partial sight and blindness.</div>', NULL)
